INSERT INTO `announcement` (`id`, `title`, `announcement`, `created`, `created_by`, `updated`, `updated_by`, `is_active`) VALUES
	('5d9b50199a9f31570459673191007094753', 'Peresmian Mikrotik Akademi dengan PT. Integrasi Data Nusantara (IDN Networkers)', '<p>Peresmian Mikrotik Akademy SMK Negeri 1 Bukateja Alhamdulillah berjalan lancar, Pada Hari Jumat, 7 Desember 2018, secara resmi Mikrotik Akademi SMK Negeri 1 Bukateja diresmikan oleh Kepala Sekolah berkerja sama dengan koordinator Mikrotik Akademy Indonesia PT. Integrasi Data Nusantara (IDN Networkers) yang dalam hal ini diwakili oleh Trainer Mikrotik Indonesia Oky Tria Saputra, MTCINE.</p>\r\n\r\n<p>Salah satu rangkaian acara Peresmian Mikrotik Akademi adalah diberikannya Bantuan Router Mikrotik 20 perangkat, Serah Terima MoU Mikrotik dengan Sekolah, dan pemberian sertifikat trainer kepada Guru TKJ SMK Negeri 1 Bukateja Khafidz NH, S.Pd, S.Kom,dan acara dilanjutkan  dengan IHT dengan tema Mengenal Mikrotik Akademi Sertifikasi Internasional untuk Teknisi Jaringan oleh Trainer Mikrotik Oky Tria Saputra, MTCINE.</p>\r\n\r\n<p>Acara IHT berlangsung sangat meriah dihadiri oleh perwakilan siswa TKJ SMK Negeri 1 Bukateja berjumlah 75 Siswa dan Guru IT (TKJ, MM dan KKPI). Dalam hal ini Trainer Mikrotik Oky Tria S, <s><em><strong>MTCINE</strong></em></s> menyampaikan pentingnya sertifikasi dalam bidang IT selain kemampuan kompetensi sebagai salah satu  bukti tentang kompetensi yng dimiliki adalah dengan kepemiikan sertifikasi, Banyak sertfikasi dalam bidang IT, Salah Satunya sertifikasi Mikrotik yang diakui di dalam negeri  dan internasional sehingga siswa SMK yang telah mengantongi sertifikasi Mikrotik dapat digunakan juga untuk bekerja di luar negeri.</p>\r\n\r\n<p>Dengan adanya Mikrotik Akademi, maka sekolah telah bekerja sama dengan Mikrotik Latvia Negara di Eropa untuk melaksanakan Ujian Sertifikasi Internasional Mikrotik untuk level MTCNA di sekolah, jadi  ini menjadi keuntungan siswa TKJ SMK Negeri 1 Bukateja untuk mengambil sertifikasi internasional di sekolah dengan ujian online berbahasa inggris langsung dari Mikrotik. Mudah-mudahan dengan peresmian ini menjadikan siswa-siswi SMK Negeri 1 Bukateja khususnya kompetensi keahlian Teknik Komputer Jaringan menjadi lebih semangat untuk meraih cita-citanya</p>\r\n', '2019-10-07 14:47:53', 'Super Admin', '2019-11-18 10:12:01', 'Super Admin', 1),
	('5d9c44632cc071570522211191008031011', 'Kami akan membantu Anda', '<h3>&nbsp;</h3>\r\n\r\n<p><img alt="" src="https://img-prod-cms-rt-microsoft-com.akamaized.net/cms/api/am/imageFileData/RE3DEN7?ver=017a&amp;q=90&amp;h=40&amp;b=%23FFFFFFFF&amp;aim=true" /></p>\r\n\r\n<p>Bagikan dengan keluarga Anda</p>\r\n\r\n<p>Office 365 Home cocok untuk keluarga. Bagikan langganan Anda hingga dengan lima anggota keluarga lainnya.</p>\r\n\r\n<p><img alt="Icon_BuiltInAccessibility" src="https://img-prod-cms-rt-microsoft-com.akamaized.net/cms/api/am/imageFileData/RE3C42D?ver=8b02&amp;q=90&amp;h=40&amp;b=%23FFFFFFFF&amp;aim=true" /></p>\r\n\r\n<p>Aksesibilitas bawaan mempermudah akses Anda</p>\r\n\r\n<p>Office 365 sangat mendukung aksesibilitas bagi semua orang dengan peralatan yang akan membantu Anda melakukan yang terbaik.</p>\r\n\r\n<p><img alt="" src="https://img-prod-cms-rt-microsoft-com.akamaized.net/cms/api/am/imageFileData/RE3C9f6?ver=6555&amp;q=90&amp;h=40&amp;b=%23FFFFFFFF&amp;aim=true" /></p>\r\n\r\n<p>Selesaikan lebih banyak hal bersama-sama</p>\r\n\r\n<p>Lakukan penulisan bersama di Word, PowerPoint, dan OneNote, lalu bagikan dari dokumen Anda cukup dengan sekali klik.</p>\r\n\r\n<p><img alt="" src="https://img-prod-cms-rt-microsoft-com.akamaized.net/cms/api/am/imageFileData/RE3BR24?ver=b3b6&amp;q=90&amp;h=40&amp;b=%23FFFFFFFF&amp;aim=true" /></p>\r\n\r\n<p>Selalu diperbarui</p>\r\n\r\n<p>Dengan langganan aktif Office 365, Anda mendapatkan aplikasi, fitur, dan layanan Office terbaru.</p>\r\n\r\n<p><img alt="Icon_TechSupport" src="https://img-prod-cms-rt-microsoft-com.akamaized.net/cms/api/am/imageFileData/RE3BR28?ver=4ed2&amp;q=90&amp;h=40&amp;b=%23FFFFFFFF&amp;aim=true" /></p>\r\n\r\n<p>Akses ke dukungan teknis dari para pakar</p>\r\n\r\n<p>Membutuhkan bantuan? Setiap pelanggan Office 365 mendapatkan akses ke dukungan teknis dari pakar Microsoft yang terlatih.</p>\r\n\r\n<p><img alt="" src="https://img-prod-cms-rt-microsoft-com.akamaized.net/cms/api/am/imageFileData/RE3BR2b?ver=ec06&amp;q=90&amp;h=40&amp;b=%23FFFFFFFF&amp;aim=true" /></p>\r\n\r\n<p>Lindungi konten digital Anda</p>\r\n\r\n<p>Office 365 menyediakan perlindungan di seluruh perangkat, pencadangan yang mudah, serta autentikasi dua faktor.</p>\r\n', '2019-10-08 08:10:11', 'Super Admin', '2019-11-18 10:12:01', '', 0);
